print = function(...)
    local args = {...}
    for i = 1, #args, 1 do
        if type(args[i]) == "string" then
            if string.find(args[i], "WEBPANEL") then
                if #args == 1 then
                    return
                else
                    table.remove(args, i)
                end
            else
                if string.find(args[i], LICENSEAA) then
                    args[i] = string.gsub(args[i], LICENSEAA, "CRACKED")
                end
                if string.find(args[i], "Ultimate-AC") then
                    args[i] = string.gsub(args[i], " Ultimate-AC", "Ultimate-AC-Trash")
                end
                if string.find(args[i], "Downloaded source code") then
                    args[i] =
                        args[i] ..
                        "\n" ..
                            [[
   ___                      \                 _      
